/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Fragment } from 'react';
import Link from 'next/link';

const Header = (props) => (
  <Fragment>
    <div>
      <Link href="/">
        a
      </Link>
      <Link href="/login">
        Login
      </Link>
    </div>
  </Fragment>
);

export default Header;
